iki\/1965\" class=\"mw-redirect\" title=\"1965\">1965<\/a>&#160;\u2014 \u041f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%BE%D0%BD%D1%81%D0%BE%D0%BD,_%D0%9B%D0%B8%D0%BD%D0%B4%D0%BE%D0%BD_%D0%91%D1%8D%D0%B9%D0%BD%D1%81\" class=\"mw-redirect\" title=\"\u0414\u0436\u043e\u043d\u0441\u043e\u043d, \u041b\u0438\u043d\u0434\u043e\u043d \u0411\u044d\u0439\u043d\u0441\">\u041b\u0438\u043d\u0434\u043e\u043d \u0411\u0435\u0439\u043d\u0441 \u0414\u0436\u043e\u043d\u0441\u043e\u043d<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043b \u0437\u0430\u043a\u043e\u043d\u043e\u043f\u0440\u043e\u0435\u043a\u0442, \u0442\u0440\u0435\u0431\u0443\u044e\u0449\u0438\u0439 \u043e\u0442 \u0438\u0437\u0433\u043e\u0442\u043e\u0432\u0438\u0442\u0435\u043b\u0435\u0439 \u0441\u0438\u0433\u0430\u0440\u0435\u0442 \u043f\u0435\u0447\u0430\u0442\u0430\u0442\u044c \u043d\u0430 \u0432\u0441\u0435\u0445 \u043f\u0430\u0447\u043a\u0430\u0445 \u043f\u0440\u0435\u0434\u0443\u043f\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0435 \u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%B1%D0%B0%D0%BA%D0%BE%D0%BA%D1%83%D1%80%D0%B5%D0%BD%D0%B8%D0%B5\" class=\"mw-redirect\" title=\"\u0422\u0430\u0431\u0430\u043a\u043e\u043a\u0443\u0440\u0435\u043d\u0438\u0435\">\u0432\u0440\u0435\u0434\u0435 \u043a\u0443\u0440\u0435\u043d\u0438\u044f<\/a> \u0434\u043b\u044f \u0437\u0434\u043e\u0440\u043e\u0432\u044c\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968\" class=\"mw-redirect\" title=\"1968\">1968<\/a>&#160;\u2014 \u0412\u0438\u0434\u043d\u044b\u0439 \u043f\u043e\u043b\u0438\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0447\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u0446\u043a\u0438\u0439<\/a> \u0434\u0435\u044f\u0442\u04