,_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u0411\u0440\u0435\u0436\u043d\u0435\u0432, \u041b\u0435\u043e\u043d\u0438\u0434 \u0418\u043b\u044c\u0438\u0447\">\u041b\u0435\u043e\u043d\u0438\u0434\u0443 \u0418\u043b\u044c\u0438\u0447\u0443 \u0411\u0440\u0435\u0436\u043d\u0435\u0432\u0443<\/a>: \u00ab\u0412\u043e\u0435\u043d\u043d\u044b\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\">\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\u0435<\/a> \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044e\u0442\u0441\u044f \u0441\u0435\u043c\u044c \u043c\u0435\u0441\u044f\u0446\u0435\u0432. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 \u0438 \u0438\u0441\u043a\u0430\u043b\u0435\u0447\u0435\u043d\u044b \u0442\u044b\u0441\u044f\u0447\u0438 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0445 \u043b\u044e\u0434\u0435\u0439 \u0438 \u0434\u0435\u0441\u044f\u0442\u043a\u0438 \u0442\u044b\u0441\u044f\u0447 \u0430\u0444\u0433\u0430\u043d\u0446\u0435\u0432, \u0433\u043b\u0430\u0432\u043d\u044b\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c, \u043c\u0438\u0440\u043d\u044b\u0445 \u0436\u0438\u0442\u0435\u043b\u0435\u0439. \u0411\u043e\u043b\u0435\u0435 \u043c\u0438\u043b\u043b\u0438\u043e\u043d\u0430 \u0430\u0444\u0433\u0430\u043d\u0446\u0435\u0432 \u0441\u0442\u0430\u043b\u0438 \u0431\u0435\u0436\u0435\u043d\u0446\u0430\u043c\u0438. \u0412\u043d\u0443\u0442\u0440\u0438 \u0421\u0421\u0421\u0420 \u0443\u0441\u0438\u043b\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u0440\u0430\u0437\u043e\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0441\u0432\u0435\u0440\u0445\u043c\u0438\u043b\u0438\u0442\u0430\u0440\u0438\u0437\u0430\u0446\u0438\u044f, \u0443\u0441\u0438\u043b\u0438\u0432\u0430\u0435\u0442\u0441\u044f \u043e\u043f\u0430\u0441\u043d\u0430\u044f \u0440\u043e\u043b\u044c \u0440\u0435\u043f\u0440\u0435\u0441\u0441\u0438\u0432\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u043e\u0432\u00bb. \u041f\u0438\u0441\u044c\u043c\u043e \u043e\u0441\u0442\u0430\u043b\u043e\u0441\u044c \u0431\u0435\u0437 \u043e\u0442\u0432\u0435\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1983\" class=\"mw-redirect\" title=\"1983\">1983<\/a>&#160;\u2014 \u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u044b \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%BC%D1%8F%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F\" title=\"\u0410\u0440\u043c\u044f\u043d\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0430\u0440\u043c\u0438\u044f\">\u0410\u0440\u043c\u044f\u043d\u0441\u043a\u043e\u0439 \u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u0410\u0440\u043c\u0438\u0438<\/a> \u0430\u0442\u0430\u043a\u043e\u0432\u0430\u043b\u0438 \u043f\u043e\u0441\u043e\u043b\u044c\u0441\u0442\u0432\u043e \u0422\u0443\u0440\u0446\u0438\u0438 \u0432 \u041f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u0438\u0438, \u0443\u0431\u0438\u0432 \u0434\u0432\u0443\u0445 (\u0436\u0435\u043d\u0443 \u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0433\u043e \u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0430 \u0438 \u043f\u043e\u0440\u0442\u0443\u0433\u0430\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u043b\u0438\u0446\u0435\u0439\u0441\u043a\u043e\u0433\u043e) \u0438 \u0440\u0430\u043d\u0438\u0432 \u043e\u0434\u043d\u043e\u0433\u043e \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430 (\u0440\u0435\u0431\u0451\u043d\u043e\u043a \u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0433\u043e \u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0430). \u0412\u0441\u0435 \u043f\u044f\u0442\u044c \u0442\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u043e\u0432&#160;\u2014 \u0442\u0430\u043a \u043d\u0430\u0437\u044b\u0432\u0430\u0435\u043c\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%81%D1%81%D0%B0%D0%B1%D0%BE%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D1%8F%D1%82%D1%91%D1%80%D0%BA%D0%B0\" class=\"mw-redirect\" title=\"\u041b\u0438\u0441\u0441\u0430\u0431\u043e\u043d\u0441\u043a\u0430\u044f \u043f\u044f\u0442\u0451\u0440\u043a\u0430\">\u041b\u0438\u0441\u0441\u0430\u0431\u043e\u043d\u0441\u043a\u0430\u044f \u043f\u044f\u0442\u0451\u0440\u043a\u0430<\/a>&#160;\u2014 \u043b\u0438\u043a\u0432\u0438\u0434\u0438\u0440\u043e\u0432\u0430\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985\" class=\"mw-redirect\" title=\"1985\">1985<\/a><ul><li>\u0421 27 \u0438\u044e\u043b\u044f \u043f\u043e 3 \u0430\u0432\u0433\u0443\u0441\u0442\u0430 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/XII_%D0%BC%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D1%84%D0%B5%D1%81%D1%82%D0%B8%D0%B2%D0%B0%D0%BB%D1%8C_%D0%BC%D0%BE%D0%BB%D0%BE%D0%B4%D1%91%D0%B6%D0%B8_%D0%B8_%D1%81%D1%82%D1%83%D0%B4%D0%B5%D0%BD%D1%82%D0%BE%D0%B2\" class=\"mw-redirect\" title=\"XII \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u0438 \u0438 \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u043e\u0432\">XII \u0412\u0441\u0435\u043c\u0438\u0440\u043d\u044b\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c \u043c\u043e\u043b\u043e\u0434\u0451\u0436\u0438 \u0438 \u0441\u0442\u0443\u0434\u0435\u043d\u0442\u043e\u0432<\/a>. \u0415\u0433\u043e \u043e\u0442\u043a\u0440\u044b\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80%D0%B1%D0%B0%D1%87%D1%91%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041c. \u0413\u043e\u0440\u0431\u0430\u0447\u0451\u0432<\/a>.<\/li><li>\u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0441\u043f\u043e\u0440\u0442\u0438\u0432\u043d\u043e-\u043f\u0438\u043b\u043e\u0442\u0430\u0436\u043d\u043e\u0433\u043e \u0430\u043a\u0440\u043e\u0431\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83-26#.D0.9C.D0.BE.D0.B4.D0.B8.D1.84.D0.B8.D0.BA.D0.B0.D1.86.D0.B8.D0.B8\" title=\"\u0421\u0443-26\">\u0421\u0423-26\u041c<\/a>, \u0432 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0448\u0438\u0440\u043e\u043a\u043e \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u044b \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043d\u044b\u0435 \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988\" class=\"mw-redirect\" title=\"1988\">1988<\/a>&#160;\u2014 \u0413\u043b\u0430\u0432\u043d\u044b\u0439 \u0432\u0440\u0430\u0447 \u0421\u0428\u0410 \u043e\u0431\u044a\u044f\u0432\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B6%D0%B8%D1%80%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u041e\u0436\u0438\u0440\u0435\u043d\u0438\u0435\">\u0442\u0443\u0447\u043d\u043e\u0441\u0442\u044c<\/a> \u043e\u0431\u0449\u0435\u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0439 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u043e\u0439 \u0437\u0434\u0440\u0430\u0432\u043e\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989\" class=\"mw-redirect\" title=\"1989\">1989<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_DC-10_%D0%B2_%D0%A2%D1%80%D0%B8%D0%BF%D0%BE%D0%BB%D0%B8\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-10 \u0432 \u0422\u0440\u0438\u043f\u043e\u043b\u0438\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u043a\u043e\u0440\u0435\u0439\u0441\u043a\u043e\u0433\u043e DC-10<\/a> \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%BF%D0%BE%D0%BB%D0%B8\" title=\"\u0422\u0440\u0438\u043f\u043e\u043b\u0438\">\u0422\u0440\u0438\u043f\u043e\u043b\u0438<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B8%D1%8F\" title=\"\u041b\u0438\u0432\u0438\u044f\">\u041b\u0438\u0432\u0438\u044f<\/a>). \u041f\u043e\u0433\u0438\u0431\u043b\u0438 \u043e\u0442 78 \u0434\u043e 82 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li>\u041d\u0430\u0447\u0430\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442 \u043c\u0438\u0440\u0430 \u0434\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u0435\u0439<\/a>-<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C%D1%84%D1%8C%D0%B5%D1%80\" title=\"\u041c\u043e\u043d\u0433\u043e\u043b\u044c\u0444\u044c\u0435\u0440\">\u043c\u043e\u043d\u0433\u043e\u043b\u044c\u0444\u044c\u0435\u0440\u043e\u0432<\/a> (27.07-08.08-1989) \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%8E%D0%BA%D1%81%D0%B5%D0%BC%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\">\u041b\u044e\u043a\u0441\u0435\u043c\u0431\u0443\u0440\u0433\u0435<\/a>. \u0412 \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0435 \u043f\u0440\u0438\u043d\u044f\u043b\u0438 \u0443\u0447\u0430\u0441\u0442\u0438\u0435 17 \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u0435\u0439. \u041f\u0435\u0440\u0432\u043e\u0435 \u0438 \u0442\u0440\u0435\u0442\u044c\u0435 \u043c\u0435\u0441\u0442\u0430 \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u043b\u0438 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0435 \u0441\u0443\u0434\u0430 AS-56 \u0444\u0438\u0440\u043c\u044b \u00ab\u041a\u043e\u043b\u0442\u00bb, \u0432\u0442\u043e\u0440\u043e\u0435 \u043c\u0435\u0441\u0442\u043e \u0437\u0430\u043d\u044f\u043b \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c DP-70 \u0444\u0438\u0440\u043c\u044b \u00ab\u041a\u0430\u043c\u0435\u0440\u043e\u043d\u00bb. \u041f\u0438\u043b\u043e\u0442 \u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044f-\u043f\u043e\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u044f&#160;\u2014 \u041e\u0441\u043a\u0430\u0440 \u041b\u0438\u043d\u0434\u0441\u0442\u0440\u0435\u043c.<\/li><li>\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0435 \u0412\u044b\u0441\u0448\u0435\u0435 \u0422\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u0423\u0447\u0438\u043b\u0438\u0449\u0435 (\u041c\u0412\u0422\u0423) \u0438\u043c. \u041d.&#160;\u042d.&#160;\u0411\u0430\u0443\u043c\u0430\u043d\u0430 \u043f\u0435\u0440\u0435\u0438\u043c\u0435\u043d\u043e\u0432\u0430\u043d\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%A2%D0%B5%D1%85%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%A3%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82_%D0%B8%D0%BC._%D0%9D._%D0%AD._%D0%91%D0%B0%D1%83%D0%BC%D0%B0%D0%BD%D0%B0\" class=\"mw-redirect\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0422\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c. \u041d. \u042d. \u0411\u0430\u0443\u043c\u0430\u043d\u0430\">\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0422\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c. \u041d. \u042d. \u0411\u0430\u0443\u043c\u0430\u043d\u0430<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1990\" class=\"mw-redirect\" title=\"1990\">1990<\/a><ul><li>\u0412\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u0439 \u0421\u043e\u0432\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0411\u0421\u0421\u0420\">\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0421\u0421\u0420<\/a> \u043f\u0440\u0438\u043d\u044f\u043b \u0414\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044e \u043e \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u043c \u0441\u0443\u0432\u0435\u0440\u0435\u043d\u0438\u0442\u0435\u0442\u0435.<\/li><li>\u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BB%D0%B4%D0%B0%D0%B2%D0%B8%D1%8F\" title=\"\u041c\u043e\u043b\u0434\u0430\u0432\u0438\u044f\">\u041c\u043e\u043b\u0434\u0430\u0432\u0438\u0438<\/a> \u043e\u0442\u043c\u0435\u043d\u0438\u043b \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B3%D0%B0%D1%83%D0%B7%D0%B8%D1%8F\" title=\"\u0413\u0430\u0433\u0430\u0443\u0437\u0438\u044f\">\u0413\u0430\u0433\u0430\u0443\u0437\u0438\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1994\" class=\"mw-redirect\" title=\"1994\">1994<\/a>&#160;\u2014 \u041f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u0438<\/a> \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u043b \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \u0442\u0435\u0441\u0442\u044b \u043f\u043e \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u0438\u044e \u043f\u043e\u043b\u0430 \u0431\u0443\u0434\u0443\u0449\u0435\u0433\u043e \u0440\u0435\u0431\u0451\u043d\u043a\u0430 \u0432 \u0441\u0432\u044f\u0437\u0438 \u0441 \u0431\u043e\u043b\u044c\u0448\u0438\u043c \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B1%D0%BE%D1%80%D1%82\" title=\"\u0410\u0431\u043e\u0440\u0442\">\u0430\u0431\u043e\u0440\u0442\u043e\u0432<\/a> \u0432 \u0441\u043b\u0443\u0447\u0430\u044f\u0445, \u043a\u043e\u0433\u0434\u0430 \u0442\u0435\u0441\u0442\u044b \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u044f\u043b\u0438, \u0447\u0442\u043e \u0440\u043e\u0434\u044f\u0442\u0441\u044f \u0434\u0435\u0432\u043e\u0447\u043a\u0438.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002\" class=\"mw-redirect\" title=\"2002\">2002<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B0%D0%B3%D0%B5%D0%B4%D0%B8%D1%8F_%D0%BD%D0%B0_%D0%B0%D0%B2%D0%B8%D0%B0%D1%88%D0%BE%D1%83_%D0%B2%D0%BE_%D0%9B%D1%8C%D0%B2%D0%BE%D0%B2%D0%B5\" class=\"mw-redirect\" title=\"\u0422\u0440\u0430\u0433\u0435\u0434\u0438\u044f \u043d\u0430 \u0430\u0432\u0438\u0430\u0448\u043e\u0443 \u0432\u043e \u041b\u044c\u0432\u043e\u0432\u0435\">\u0422\u0440\u0430\u0433\u0435\u0434\u0438\u044f \u043d\u0430 \u0430\u0432\u0438\u0430\u0448\u043e\u0443 \u0432\u043e \u041b\u044c\u0432\u043e\u0432\u0435<\/a>, \u0441\u0430\u043c\u0430\u044f \u043a\u0440\u0443\u043f\u043d\u0430\u044f \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043c\u0438\u0440\u043e\u0432\u044b\u0445 \u0430\u0432\u0438\u0430\u0448\u043e\u0443. \u0412 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u043f\u0430\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83-27\" title=\"\u0421\u0443-27\">\u0421\u0443-27<\/a> \u043f\u043e\u0433\u0438\u0431\u043b\u043e 77 \u0447\u0435\u043b\u043e\u0432\u0435\u043a (\u043f\u043e \u043d\u0435\u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u0434\u0430\u043d\u043d\u044b\u043c&#160;\u2014 \u0434\u043e 84).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2010\" class=\"mw-redirect\" title=\"2010\">2010<\/a>&#160;\u2014 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u0435 \u043d\u043e\u0432\u043e\u0439 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%B3%D0%B8%D0%B7%D0%B8%D1%8F\" title=\"\u041a\u0438\u0440\u0433\u0438\u0437\u0438\u044f\">\u041a\u0438\u0440\u0433\u0438\u0437\u0438\u0438<\/a>.<\/li><\/ul><h2>"}